import React from 'react'
import { connect } from 'react-redux'

class ListItems extends React.Component {
    render() {
        const { items, dispatchSetItemsToStore } = this.props
        return(
            <div>
                <ul>
                    {
                        items.map((item, i) => (
                            <li key={i} onClick={() => dispatchSetItemsToStore(item)}>
                                <p>{item.name}</p>
                                <p>{item.price}</p>
                                <p>{item.type}</p>
                            </li>
                        ))
                    }
                </ul>
            </div>
        )
    }
}



export default connect(null, mapDispatchToProps)(ListItems)
